using System;
using System.Collections.Generic;
using System.Text;
using System.Reflection;
using System.IO;

namespace NET_Source_Protection
{
    class Program
    {
        static void Main(string[] args)
        {
            string encrypted = "";
            byte[] assembly = Encryption.Decrypt(encrypted, Encoding.ASCII.GetBytes("hello, I'm a test key"));
            Assembly asm = Assembly.Load(assembly);
            Type[] type = asm.GetTypes();
            foreach (Type t in type)
            {
                if (typeof(IStartUp).IsAssignableFrom(t))
                {
                    ((IStartUp)Activator.CreateInstance(t)).Start();
                    break;
                }
            }
        }
    }
}
